@centerconsolesonly caught up with @petermillerunchartedwaters yesterday for a cool announcement: The band is back together for a fun time at this Saturday’s CCO Showdown! It’s not too late to sign up and the captain’s meeting is this evening at @montysrawbarcg 

Peter & Alan also talk a little bit about his boat “Get Lit IX,” a 35’ Catamaran powered by twin @mercurymarine 400 Verados. 

